(5, 1, 'Runtz', 'Flower', 'Fruit, Pineapple, Spicy/Herbal', '', 'Runtz is an evenly balanced hybrid strain (50% indica/50% sativa) created through a delicious cross of the infamous Zkittlez X Gelato strains. Named for the iconic candy, Runtz brings on a super delicious fruity flavor.', 'https://leafedout.com/storage/usercontent/pp/LeafedOut-pGeAI4qCHmVE6Q7abNVxvONkL6rezF51kDgn6Vdb.v1671570813.jpg, https://leafedout.com/storage/usercontent/photos/LeafedOut-xzds7G0tyqW3ZGEHkDzE3DuXUMi5K9QYUzClRdDK.jpeg'),
(6, 1, 'Oreoz', 'Flower', 'Diesel, Nutty, Spicy/Herbal', 'Happy, Uplifted', 'Oreoz is an indica dominant hybrid strain (70% indica/30% sativa) created through crossing the delicious Cookies N Cream X Secret Weapon strains. Named for its super delicious flavor, Oreoz is a great choice for any indica lover.', 'https://leafedout.com/storage/usercontent/pp/LeafedOut-pGeAI4qCHmVE6Q7abNVxvONkL6rezF51kDgn6Vdb.v1671570813.jpg, https://leafedout.com/storage/usercontent/photos/LeafedOut-og8wslWGsFURs7VMp6XyJrojodQDWigoL9172rkB.jpeg'),
